The best time to visit this is place is around 5 pm to watch the sunset. To enter the beach you must pay the entrance fee Rp 8.000 / person and Rp 5.000 for motorbike.

To access the beach club, you must go down to the beach because the entrance gate for this beach club can be accessed from the beach and it's easy to find with loud music.

Pamilla Bali provides wide selection of wine, tequila, whiskey, cocktail and other alcohol. For non alcohol drink you can find Juices, Water, and Soft drink start from IDR 30 K.¬† And for the food they only have Pizza, Salad, Toast & Sandwich for now.

